import React from "react";
function CryptoDetails(props) {
    return (
        <div className="cryptoDetails">
            <h4><b>{props.symbol.toUpperCase()}</b> {props.current_price} $</h4>
            <ul>
                <li>Highest in last 24h: {props.highest_24h} $</li>
                <li>Lowest in last 24h: {props.lowest_24h} $</li>
                <li><b>All time high: {props.ath} $</b></li>
            </ul>
        </div>
    );
}

export default CryptoDetails;
